import { useEffect, useState } from 'react';
import Button from './Button.js';
import './Liste_page.css';

function Liste_page(){
    return(
        <div class="container main-container d-flex align-items-center justify-content-center ">
            <div class="row w-100">
                <div class="col-md-6 col-12 d-flex flex-column align-items-center">
                    <Button text="Mathématique" className="matière btn-block mb-3"></Button>
                    <Button text="Physique Chimie" className="matière btn-block mb-3"></Button>
                    <Button text="SVT" className="matière btn-block mb-3"></Button>
                    <Button text="NSI" className="matière btn-block mb-3"></Button>
                    <Button text="SI" className="matière btn-block mb-3"></Button>
                </div>
                <div class="col-md-6 col-12 d-flex flex-column align-items-center">
                    <Button text="Histoire" className="matière btn-block mb-3"></Button>
                    <Button text="Français" className="matière btn-block mb-3"></Button>
                    <Button text="Philosophie" className="matière btn-block mb-3"></Button>
                    <Button text="HGGSP" className="matière btn-block mb-3"></Button>
                    <Button text="HLP" className="matière btn-block mb-3"></Button>
                </div>
            </div>
        </div>
    )
}

export default Liste_page;
